details:
according to the law - http://code.cuyahogacounty.us/en-US/CCRC-T4C405.aspx 
they are required to provide the following each year: 

    The name, phone number, and address of the registered lobbyist and all of its employees or agents who engage in lobbying activities;
    A list of all clients, including names, phone numbers, addresses, and nature of business, from whom the registered lobbyist receives compensation for engaging in lobbying activities;
    A statement of all matters on which the registered lobbyist has lobbied for each client in the past year, or on which the registered lobbyist is contracted to lobby in the future;
    A list of any past positions held by the registered lobbyist or any of its employees or agents as an elected official, employee, or board member of a city, county or state, and the period of time during which each individual held such position;
    Any other information as may be required by the Inspector General.

Openly licenced? comments:
Listed as "The license for this dataset is unspecified" on the open data portal

Verbal clarification from NYC DoITT staff "we consider datasets non-copywritable";

"we are working on updating the terms of use more clear about this, but it is also clearly stated in the open data law for now"
